import React, { useState } from "react";

const AddNewActivityModal = ({ isOpen, onClose, onAddActivity }) => {
  const [activityData, setActivityData] = useState({
    name: "",
    description: "",
    time: "",
    category: "",
    location: "",
  });

  if (!isOpen) return null;

  const handleChange = (e) => {
    const { name, value } = e.target;
    setActivityData((prev) => ({
      ...prev,
      [name]: value,
    }));
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    if (!activityData.name || !activityData.location) {
      return alert("Please fill in all required fields (*)");
    }
    onAddActivity(activityData);
    setActivityData({
      name: "",
      description: "",
      time: "",
      category: "",
      location: "",
    });
  };

  return (
    <div className="fixed inset-0 z-50 flex items-center justify-center 
                    bg-black/40 backdrop-blur-md transition-opacity animate-fadeIn p-4">

      {/* Modal */}
      <div className="bg-white rounded-2xl shadow-2xl w-full max-w-md 
                      animate-slideUp overflow-hidden">

        {/* Header */}
        <div className="flex items-center justify-between px-6 py-4 border-b border-gray-200">
          <h3 className="text-xl font-semibold text-gray-900">
            Add New Activity
          </h3>

          <button
            onClick={onClose}
            className="text-gray-500 hover:text-gray-800 transition"
            aria-label="Close modal"
          >
            <svg
              className="w-6 h-6"
              fill="none"
              stroke="currentColor"
              viewBox="0 0 24 24"
            >
              <path
                strokeLinecap="round"
                strokeLinejoin="round"
                strokeWidth="2"
                d="M6 18L18 6M6 6l12 12"
              ></path>
            </svg>
          </button>
        </div>

        {/* Form */}
        <form onSubmit={handleSubmit} className="px-6 py-5 space-y-4">

          {/* Name */}
          <div>
            <label className="text-sm font-medium text-gray-700">
              Activity Name*
            </label>
            <input
              type="text"
              name="name"
              value={activityData.name}
              onChange={handleChange}
              className="w-full mt-1 px-3 py-2 bg-gray-100 border border-gray-300 rounded-lg 
                         focus:ring-2 focus:ring-blue-500 focus:border-blue-500 outline-none"
              required
            />
          </div>

          {/* Description */}
          <div>
            <label className="text-sm font-medium text-gray-700">
              Description
            </label>
            <textarea
              name="description"
              value={activityData.description}
              onChange={handleChange}
              rows="2"
              className="w-full mt-1 px-3 py-2 bg-gray-100 border border-gray-300 rounded-lg 
                         resize-none focus:ring-2 focus:ring-blue-500 focus:border-blue-500 outline-none"
            ></textarea>
          </div>

          {/* Time + Category */}
          <div className="flex gap-4">
            <div className="flex-1">
              <label className="text-sm font-medium text-gray-700">Time</label>
              <input
                type="time"
                name="time"
                value={activityData.time}
                onChange={handleChange}
                className="w-full mt-1 px-3 py-2 bg-gray-100 border border-gray-300 rounded-lg 
                           focus:ring-2 focus:ring-blue-500 focus:border-blue-500 outline-none"
              />
            </div>

            <div className="flex-1">
              <label className="text-sm font-medium text-gray-700">Category</label>
              <input
                type="text"
                name="category"
                value={activityData.category}
                onChange={handleChange}
                className="w-full mt-1 px-3 py-2 bg-gray-100 border border-gray-300 rounded-lg 
                           focus:ring-2 focus:ring-blue-500 focus:border-blue-500 outline-none"
              />
            </div>
          </div>

          {/* Location */}
          <div>
            <label className="text-sm font-medium text-gray-700">Location*</label>
            <input
              type="text"
              name="location"
              value={activityData.location}
              onChange={handleChange}
              required
              className="w-full mt-1 px-3 py-2 bg-gray-100 border border-gray-300 rounded-lg 
                         focus:ring-2 focus:ring-blue-500 focus:border-blue-500 outline-none"
            />
          </div>

          {/* Buttons */}
          <div className="flex justify-end gap-3 pt-3">
            <button
              type="button"
              onClick={onClose}
              className="px-5 py-2 bg-gray-200 text-gray-700 rounded-lg 
                         hover:bg-gray-300 transition font-medium"
            >
              Cancel
            </button>

            <button
              type="submit"
              className="px-6 py-2 bg-black text-white rounded-lg 
                         hover:bg-gray-800 transition font-medium shadow-md"
            >
              Add Activity
            </button>
          </div>
        </form>
      </div>
    </div>
  );
};

export default AddNewActivityModal;
